sys_variable_value.value:
(function execute(inputs, outputs) {

var deduction =[];

var effectiveDate=inputs.deductions.sys_created_on;
  var dt = effectiveDate.split(' ');
  var f = dt[0].split('-');
  var t = dt[1].split(':');
  var event = new Date(f[0], f[1]-1, f[2], t[0], t[1], t[2]);
  effectiveDate= event.toISOString();
var createdDate=inputs.deductions.sys_created_on;
  var dt = createdDate.split(' ');
  var f = dt[0].split('-');
  var t = dt[1].split(':');
  var event = new Date(f[0], f[1]-1, f[2], t[0], t[1], t[2]);
  var createdDate = event.toISOString();

 var modifiedDate=inputs.deductions.sys_created_on;
  var dt = modifiedDate.split(' ');
  var f = dt[0].split('-');
  var t = dt[1].split(':');
  var event = new Date(f[0], f[1]-1, f[2], t[0], t[1], t[2]);
  var modifiedDate = event.toISOString();


while(inputs.child_deduction.next()) { 

  var createdOn=inputs.child_deduction.sys_created_on;
  var dt = createdOn.split(' ');
  var f = dt[0].split('-');
  var t = dt[1].split(':');
  var event = new Date(f[0], f[1]-1, f[2], t[0], t[1], t[2]);
  createdOn= event.toISOString();


  var childDeduction =inputs.child_deduction;
  var createdBy =inputs.deductions.created_by;

  var deductionItem = {
    "deduction_ticket_id": createdBy.deduction_ticket_id,
    "deductionType": childDeduction.deduction_type.toString(),
    "deductionAmount": childDeduction.deduction_value.toString(),
    "createdOn":createdOn,
    "createdBy": {
      "enterpriseColleagueId": createdBy.hashed_user_id.toString(),
      "firstName": createdBy.first_name.toString(),
      "lastName": createdBy.last_name.toString()
    }
  };
deduction.push(deductionItem);
}

var obj = {

  "voluntaryDeductionId":inputs.deductions.number.toString(),
  //"enterpriseTalentId":inputs.deductions.talent_id.toString(),
  "enterpriseTalentId":inputs.deductions.talent_user.enterprise_talent_id.toString(),
  "effectiveDate":effectiveDate,
  "status": inputs.deductions.status.toString(),
  "owner": {
  "enterpriseColleagueId": inputs.deductions.owner.hashed_user_id.toString(),
        "firstName": inputs.deductions.owner.first_name.toString(),
        "lastName": inputs.deductions.owner.last_name.toString()
  },
  "timestamp": {
    "createdDateTime": createdDate,
    "modifiedDateTime": modifiedDate
  },
  "createdBy": {
      "enterpriseColleagueId": inputs.deductions.created_by.hashed_user_id.toString(),
        "firstName": inputs.deductions.created_by.first_name.toString(),
        "lastName": inputs.deductions.created_by.last_name.toString()

  },
  "modifiedBy": {
  "enterpriseColleagueId": inputs.deductions.created_by.hashed_user_id.toString(),
        "firstName": inputs.deductions.created_by.first_name.toString(),
        "lastName": inputs.deductions.created_by.last_name.toString()

      }
      ,
 "deductionItems":deduction,

  "traceInfo": {
    "traceId": inputs.deductions.trace_id.toString(),
    "spanId": inputs.deductions.span_id.toString()
  }
};

  //obj["voluntaryDeductionId"]=id.toString();
  //obj.enterpriseTalentId=inputs.deductions.talent_id;
  //var j=new global.JSON().encode(obj);
 var j = JSON.stringify(obj);

outputs.fct_payload=j;
 outputs.id=deductionItem;
//var abc=deduction.toString();
 outputs.variable=deduction[0][0];
})(inputs, outputs);

